using OfficeOpenXml;\nusing System.Collections.Generic;\nusing System.IO;\n\npublic void ExportToExcel(List<List<object>> outputRows)\n{\n    using (var package = new ExcelPackage())\n    {\n        var worksheet = package.Workbook.Worksheets.Add("Sheet1");\n\n        for (int row = 0; row < outputRows.Count; row++)\n        {\n            for (int col = 0; col < outputRows[row].Count; col++)\n            {\n                worksheet.Cells[row + 1, col + 1].Value = outputRows[row][col];\n            }\n        }\n\n        using (var stream = new FileStream("output.xlsx", FileMode.Create))\n        {\n            package.SaveAs(stream);\n        }\n    }\n}